def tower_of_hanoi(n, source, auxiliary, destination):
    """
    Function to solve the Tower of Hanoi problem recursively.

    Parameters:
        n (int): The number of disks to move.
        source (str): The peg where the disks start.
        auxiliary (str): The auxiliary peg used for moving disks.
        destination (str): The peg where the disks should end up.
    """
    # Base case: If there's only one disk, move it directly to the destination
    if n == 1:
        print("Move Disk", n, "from", source, "to", destination)
    else:
        # Move n-1 disks from the source peg to the auxiliary peg using the destination peg as a helper
        tower_of_hanoi(n-1, source, destination, auxiliary)

        # Move the largest disk from the source peg to the destination peg
        print("Move Disk", n, "from", source, "to", destination)

        # Move the n-1 disks from the auxiliary peg to the destination peg using the source peg as a helper
        tower_of_hanoi(n-1, auxiliary, source, destination)

# Example for n=2
tower_of_hanoi(2, 'A', 'B', 'C')

